import React from 'react';
import './FinancialStatusCard.css';

const FinancialStatusCard = ({ totalRevenue, netProfit }) => (
  <div className="financial-status-card">
    <div className="financial-status-header">الوضع المالي - يناير 2024</div>
    <div className="financial-status-values">
      <div>
        <span>إجمالي الإيرادات</span>
        <h2>{totalRevenue}</h2>
      </div>
      <div>
        <span>صافي الربح</span>
        <h2>{netProfit}</h2>
      </div>
    </div>
  </div>
);

export default FinancialStatusCard;
